import React, { Component } from 'react'
import mIcon from '../../resources/images/hamIcon.svg'

export class detailBox extends Component {
	render() {
		return (
			<React.Fragment>
				Here are the detaials!!!!!!!!
			</React.Fragment>
		)
	}
}

export class menuIcon extends Component {
	render() {
		return (
			<React.Fragment>
				<img src='{mIcon}'></img>
			</React.Fragment>
		)
	}
}
